import React from 'react';
import Avatar from '@material-ui/core/Avatar';
import Button from '@material-ui/core/Button';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Typography from '@material-ui/core/Typography';
import {makeStyles} from "@material-ui/core/styles";

import './IntroPage.css'

const useStyles = makeStyles((theme) =>({
  button: {
    textTransform: "none",
    width: 170,
    marginTop: 20,
    margin: theme.spacing(5),
    marginBottom: 20,
  },
  root: {
    justifyContent: 'center',
    padding: 10,
  },
  large: {
    width: theme.spacing(40),
    height: theme.spacing(40),
  },
  bio: {
    minWidth: 550,
    maxWidth: 550,
    justifyContent: 'center',
  }
}));

export default function IntroPage() {
  const button_classes = useStyles();

  return (
    <div>
      <CardActions classes={{root: button_classes.root}}>
        <Avatar className={button_classes.large} src="profile_pic.png" />
      </CardActions>

      <CardActions classes={{root: button_classes.root}}>
        <Typography variant="h4" gutterBottom>
          Johnson Chau
        </Typography>
      </CardActions>

      <CardActions classes={{root: button_classes.root}}>
        <Card className={button_classes.bio}>
          <CardContent>
            <Typography variant="body1" component="p" align="center">
              A 2nd year Business Analytics and Computer Science student at University of Sydney, Active Programmer 🖥 and Problem Solver 🧩
            </Typography>
          </CardContent>
        </Card>
      </CardActions>

      <CardActions>
        <Card>
          <CardActionArea>
            <CardContent>
              <Typography gutterBottom variant="h5" component="h2">
                S&P500 vs AMD Data Project
              </Typography>
              <Typography variant="body2" color="textSecondary" component="p">
                Personal data project for explaining relationship between S&P500 and AMD between 2018 to 2019
              </Typography>
            </CardContent>
          </CardActionArea>
          <CardActions>
            <Button size="small" color="primary" href="https://github.com/johnsonchau7/sp500vsAMD" target="_blank">
              Learn More
            </Button>
          </CardActions>

        </Card>

      </CardActions>

      <CardActions classes={{root: button_classes.root}}>
        <Button className={button_classes.button} variant="outlined" fullWidth="false" href="Johnson_Chau_CV.pdf" target="_blank" >Resume</Button>
        <Button className={button_classes.button} variant="outlined" href="Johnson_Chau_Academic_Transcript.pdf" target="_blank">Academic Transcript</Button>
        <Button className={button_classes.button} variant="outlined" href="https://www.linkedin.com/in/johnsonchau7/" target="_blank">LinkedIn</Button>
        <Button className={button_classes.button} variant="outlined" href="https://github.com/johnsonchau7" target="_blank">GitHub</Button>
      </CardActions>

    </div>
  );
}
